import { Menu } from 'antd'
import React, { Component } from 'react'

export default class LeftMain extends Component {
  render() {
    return (
      <Menu
      mode='inline'
      openKeys={openkeys}
      onOpenChange = {onOpenChange}
      style = {{width:"100%"}}
      items = {items}
      />
    )
  }
}
